    return (
        <section id="mission">   
            <div className="mission-container">
                <h3>Our Mission</h3>
                <p>HomeFood is a platform that will deliver freshly prepared meals on to your door step. As it is our motto to provide fresh meal, 
                that our customer's  an eat 365 days without making any adjustment on their health and wallet.</p>
            </div>
        </section>
    );
}


export default Mission;
